import styled from 'styled-components';

const FooterStyles = styled.li`
  #footer {
    display: grid;
    grid-gap: 0;
    padding: 0;
    margin: 0;
    grid-template-columns: 10vw auto auto auto 10vw;
    grid-template-rows: 30vh;
    background-color: slategray;
    border-top: black ;
    li {
      list-style-type: none;
    }
  }

  h1 {
    font-size: 10px;
    color: snow;
    text-decoration: none;
  }

  h1:hover {
    text-decoration: underline;
  }

  #left {
    grid-row: 1;
    grid-column: 2;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }
  #center {
    grid-row: 1;
    grid-column: 3;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }

  #right {
    grid-row: 1;
    grid-column: 4;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }
`;

export default FooterStyles;
